                          const Real_t dt, const Real_t u_cut,
                          Index_t numNode)
{

#pragma acc parallel loop present(xd[0:numNode], \
                                  yd[0:numNode], \
                                  zd[0:numNode], \
                                  xdd[0:numNode], \
                                  ydd[0:numNode], \
