  for ( Index_t i = 0 ; i < numNode ; ++i )
  {
    Real_t xdtmp, ydtmp, zdtmp ;

    xdtmp = xd[i] + xdd[i] * dt ;
    if( fabs(xdtmp) < u_cut ) xdtmp = Real_t(0.0);
    xd[i] = xdtmp ;

    ydtmp = yd[i] + ydd[i] * dt ;
    if( fabs(ydtmp) < u_cut ) ydtmp = Real_t(0.0);
    yd[i] = ydtmp ;

    zdtmp = zd[i] + zdd[i] * dt ;
    if( fabs(zdtmp) < u_cut ) zdtmp = Real_t(0.0);
    zd[i] = zdtmp ;
  }
}

