static inline
void CalcLagrangeElements(Domain& domain, Real_t* vnew)
{
  Index_t numElem = domain.numElem() ;
  Index_t numNode = domain.numNode() ;
  if (numElem > 0) {
    const Real_t deltatime = domain.deltatime() ;

    // strains are now allocated at startup to prevent unnecessary mem transfers
    Real_t *dxx = domain.dxx();
    Real_t *dyy = domain.dyy();
    Real_t *dzz = domain.dzz();

    Real_t *x = domain.x();
    Real_t *y = domain.y();
    Real_t *z = domain.z();
    Real_t *xd = domain.xd();
    Real_t *yd = domain.yd();
    Real_t *zd = domain.zd();
    Real_t *v = domain.v();
    Real_t *volo = domain.volo();
    Real_t *vdov = domain.vdov();
    Real_t *delv = domain.delv();
    Real_t *arealg = domain.arealg();

    Index_t *nodelist = domain.nodelist();

    CalcKinematicsForElems(nodelist,
                           x, y, z,
                           xd, yd, zd,
                           dxx, dyy, dzz,
                           v, volo,
                           vnew, delv, arealg,
                           deltatime, numElem, numNode);

    // element loop to do some stuff not included in the elemlib function.
    int abort = 0;

#pragma omp target teams distribute parallel for reduction(|:abort)
    for ( Index_t k=0 ; k<numElem ; ++k )
    {
      // calc strain rate and apply as constraint (only done in FB element)
      Real_t vdov_k = dxx[k] + dyy[k] + dzz[k] ;
      Real_t vdovthird = vdov_k/Real_t(3.0) ;

      // make the rate of deformation tensor deviatoric
      vdov[k] = vdov_k ;
      dxx[k] -= vdovthird ;
      dyy[k] -= vdovthird ;
      dzz[k] -= vdovthird ;

      // See if any volumes are negative, and take appropriate action.
      if (vnew[k] <= Real_t(0.0))
      {
        abort = 1;
      }
    }
    if(abort) {
#if USE_MPI
    MPI_Abort(MPI_COMM_WORLD, VolumeError) ;
#else
    fprintf(stderr, "VolumeError in CalcKinematicsForElems at cycle %d\n",
            domain.cycle());
    exit(VolumeError);
#endif
    }

  } // end if numElem > 0
}

